import React from "react";
import { Container } from "react-bootstrap";
import "./style.css";

const Box = () => {
    return ( 
        <div>
            <input type="text"/>
        </div>
     );
}

const Contact = () => {
    return (
        <div style={{paddingTop:"150pt", paddingBottom: "150pt"}}>
            <Container>
                <h1>Contact Us</h1>
                <Box />
                <Box />
                <Box />
                <Box />            </Container>
        </div>
    )
}

export default Contact;
